mapper.select:
select 

from REL_DTL
where WORK_CENTER = #{workCenter,jdbcType=NVARCHAR}
  and STORER_ID = #{storerId,jdbcType=NVARCHAR}
  and REL_ID = #{relId,jdbcType=NVARCHAR}
  and BATCH_NO = #{batchNo,jdbcType=INTEGER}
  and REL_LINE_SEQ = #{relLineSeq,jdbcType=BIGINT}

mapper.delete:
delete from REL_DTL
where WORK_CENTER = #{workCenter,jdbcType=NVARCHAR}
  and STORER_ID = #{storerId,jdbcType=NVARCHAR}
  and REL_ID = #{relId,jdbcType=NVARCHAR}
  and BATCH_NO = #{batchNo,jdbcType=INTEGER}
  and REL_LINE_SEQ = #{relLineSeq,jdbcType=BIGINT}
